import {Row, Col, Container} from "react-bootstrap";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import honestidad from '../assets/img/valores/juramento.png';
import respeto from '../assets/img/valores/el-respeto.png';
import responsabilidad from '../assets/img/valores/responsabilidad.png';
import transparencia from '../assets/img/valores/monitor.png';


export const Historia  = () =>{

    const responsive = {
        superLargeDesktop: {
 
          breakpoint: { max: 4000, min: 3000 },
          items: 5
        },
        desktop: {
          breakpoint: { max: 3000, min: 1024 },
          items: 3
        },
        tablet: {
          breakpoint: { max: 1024, min: 464 },
          items: 2
        },
        mobile: {
          breakpoint: { max: 464, min: 0 },
          items: 1
        }
      };
     
      return(
          <section className="historia" id="historia">
              <Container>
                  <Row>
                        <Col>
                            <div className="historia-bx">
                                    <h2>
                                        Historia sobre la empresa Aguas de Danlí.
                                    </h2>


                                    <p class="texto1">
                                    La Unidad Municipal Desconcentrada Aguas de Danlí es el ente encargado de brindar el 
                                    servicio de agua potable en la zona oriental, específicamente en la Ciudad de Danlí, El 
                                    Paraíso, cabe mencionar que dicho servicio era brindado anteriormente por el SANAA, el 
                                    cual hizo traspaso a la Alcaldía Municipal de la Ciudad de Danlí el 01 de septiembre del 
                                    año 2010 para que llevara el control de dicho servicio mediante la empresa Aguas de Danlí
                                    </p>
                                    <h1>Valores Institucionales</h1>

                                    <Carousel responsive={responsive} infinite={true} className="historia-slider">
                                           
                                            <div className="item">
                                                <img src={honestidad} alt="Image" />
                                                <h5>Honestidad</h5>
                                            </div>
             
                                            <div className="item">
                                                <img src={respeto} alt="Image" />
                                                <h5>Respeto</h5>
                                            </div>

                                            <div className="item">
                                                <img src={responsabilidad} alt="Image" />
                                                <h5>Responsabilidad</h5>
                                            </div>

                                            <div className="item">
                                                <img src={transparencia} alt="Image" />
                                                <h5>Transparencia</h5>
                                            </div>
                                    </Carousel>
                            </div>
                        </Col>
                  </Row>
              </Container>
         
          </section>
      )

}
